sys_variable_value.value:
(function execute(inputs, outputs) {

  if(inputs.type == "long"){
    outputs.points_captured = inputs.exit_price - inputs.entry_price;
    outputs.total_pl = outputs.points_captured*inputs.quantity;
    outputs.pl_percent = ((outputs.total_pl) / (inputs.entry_price*inputs.quantity))*100
  } else{
    outputs.points_captured = inputs.entry_price - inputs.exit_price;
    outputs.total_pl = outputs.points_captured*inputs.quantity;
    outputs.pl_percent = ((outputs.total_pl) / (inputs.entry_price*inputs.quantity))*100
  }

  var duration = GlideDateTime.subtract(new GlideDateTime(inputs.entry_date), new GlideDateTime(inputs.exit_date));
  outputs.duration = (duration.getDayPart() >=1) ? duration.getDayPart() : 1;
})(inputs, outputs);

